import React from "react";
import { NaverMap } from "react-naver-maps";

class App extends React.Component {
  render() {
    return (
      <div>
        <NaverMap
          style={{
            width: "100%",
            height: "100vh",
          }}
        />
      </div>
    );
  }
}

export default App;
